import React from "react"
import { TextWithIconProps, WhiteBoxProps } from "./types"

export const TextWithIcon = ({ text, icon }: TextWithIconProps) => {
    return (
        <div className="flex items-center flex-col">
            <img src={`images/${icon}`}  alt='' />
            <p className="text-[#0E253CD9] text-[12px] font-normal">{text}</p>
        </div>
    )
}

export const WhiteBgBox = ({children}:WhiteBoxProps) =>{
    return(
        <div>
            {children}
        </div>
    )
}
